import React, { useState } from "react";
import "./Signup.css";

function Mignup() {


   const [copyItem,setCopyItem]=useState()
   const [suteItem,setSureItem]=useState()

   const copyvalue=(E,B,C,D)=>{

    setCopyItem([E,B,C,D])

   }


  return (
    <div>
      <div className="loginPage">
        <div className="organize">
          <p className="loginString">sdasda in</p>
        </div>
        <div className="inputLogin">
          <input type="email" className="firstInput" placeholder="firstName" onChange={e=>copyvalue(e.target.value,'','','')} />
          <input type="password"className="secondInput"placeholder="secondeName"onChange={e=>copyvalue('',e.target.value,'','')} />
          <input type="password" className="secondInput" placeholder="email"  onChange={e=>copyvalue('','',e.target.value,'')} />
          <input type="password" className="secondInput"placeholder="enterYourPassword" onChange={e=>copyvalue('','','',e.target.value)} />
        </div>

        <div className="enterToLogIin">
          <h1 className="enterToLogIinString" onClick={()=>{onSaveSure}}>sign in</h1>
          <a className="signInString">log in </a>
        </div>
      </div>
    </div>
  );
}

export default Mignup;
